verse: GEN.005.006
translations:
  mal-C: ശേത്തിനു 105 വയസ്സായപ്പോൾ അദ്ദേഹത്തിന് ഏനോശ് ജനിച്ചു.
  deu-TKW: Als nun Seth 105 Jahre alt war, erzeugte er den Enos.
  lin-lin: Tango Seti akokisaki mibu nkama moko na mitano ya mbotama, abotaki Enoshi.
  cbr-NT: Set ax ciento cinco baritiañu 'ain ka aín rëkuën bakë bëchikë Enós kakë
    ax bakë́ankëxa.
  eng-LSV: And Seth lives one hundred and five years [[or two hundred and five years]],
    and begets Enos.
  bmu-bmu: Kömuiga nahönŋi Set yaŋön yambuŋi 105 aiga nahönŋi Enos asuhuyök.
  eng-GNV: And Sheth liued an hundreth and fiue yeeres, and begate Enosh.
  eng-WEBSTER: 'And Seth lived a hundred and five years, and begat Enos:'
  nhw-BL: Huan Set quipiyayaya 105 xihuitl quema tlacatqui icone, Enós.
  swh-ONEN: Sethi alipokuwa ameishi miaka 105, akamzaa Enoshi.
  bba-bba: Ye Sɛti u kuɑ wɔ̃ɔ wunɔbu kɑ nɔɔbu (105), yerɑ u Enɔsi mɑrɑ.
  eng-KJVCPB: 'And Seth lived an hundred and five years, and begat Enos:'
  cpy-cpy: Tzimanaki rirori Set okaatzi 105 rojarentsite, aripaete itzimaki itomi
    iitakiri Enós.
  mpx-mpx: Seti wana baliman 105 yaka natuna i gan alana Inosi.
  wbp-wbp: Yangka Jiiti, Yatumu-kurlangu ngalapi-nyanu, ngulaju nyinaja yukuriki 105-palaku.
    Ngula-jangka, ngulakujurla kurdulku palka-jarrija wirriya yirdiji Yinaji.
  luo-luo: Ka Seth ne ja-higni mia achiel gabich, nonywolo Enosh.
  meu-meu: Set ena mauri laḡanidia na sinahu-ta dikoana ima negana ai, ia ese Enos
    e havaraia;
  npi-ULB: शेत १०५ वर्षको हुँदा तिनी एनोशको बुबा भए ।
  yor-yor: Nígbà tí Seti pé àrùnlélọ́gọ́rùn-ún ọdún, ó bí Enoṣi.
  emp-NTPO: Sera ciento cinco poa b̶asid̶e Enóda unusia.
  ind-ind: Set berumur 105 tahun ketika anaknya yang bernama Enos lahir.
  pes-OPCB: 'شیث: وقتی شیث ۱۰۵ ساله بود، پسرش انوش به دنیا آمد. بعد از تولد انوش،
    شیث ۸۰۷ سال دیگر عمر کرد و صاحب پسران و دختران شد. شیث در سن ۹۱۲ سالگی مرد.'
  ssx-ssx: Mo Sedi ipika꞉ bapi 105 yeketa꞉ biki Inosi leeke weki mondu wiekeme.
  lcm-lcm: Na Set kala 105 na matas na kala atogon kakana ta kun nat kana asan ta
    Enos.
  aer-aer: Kenhe Seth re akenhe itethe akwete anthurre anerle-aneke, year 105-pelenge
    re alere akweke atnyeneke Enosh arritnye antheke.
  tgl-ULB: Nang nabuhay si Set ng 105 taon, siya ay naging ama ni Enos.
  nop-nop: Set adi guletŋiŋ 105 tulune adi’walaŋ mihiŋiŋ Enos mintaguk.
  kca-kca: Сиф, нуптәԓ сот вет тӑԓ уԓмаԓән, Енос пŏх тӑйәс.
  cbu-NT: Anumunshat, Setshat mang 105 masachirini taaramchu anush Enosaa iparinarangiya.
  hui-hui: Adama igini Sede ibu mali handari mbirani duria (105) heangi ibu oneme
    igiri mbira mini Inoso taba hanayagola Sede ibu igiri ogoninaga aba hene.
  wrs-wrs: Setva os ana, venamba 105pelara osomba, wo ombolva pola, os awona Enosm.
  mya-mya: ရှေ​သ​သည်​အ​သက်​တစ်​ရာ့​ငါး​နှစ်​ရှိ​သော အ​ခါ​သား​ဧ​နုတ်​ကို​ရ​၏။-
  cbi-NTPO: Set 105 añu juunu uwanu na miyandimi Enósnu.
  bod-N: དེ་ནས་སེད་ཐུ་ལོ་བརྒྱ་དང་ལྔ་ལོན་པའི་དུས་སུ་བུ་ཨེ་ནོ་ཤཱ༌སྐྱེས།
  wsk-wsk: Seth ko yia tom 105 asele noko kuriang kari gira aratam, mu Enosh.
  kkl-kkl: Set wamogti heng kun-kunne teng wilindi eptopne tom tarabare (105) wamogti,
    me nengabo me sina Enos mangaro aog.
  sna-sna: Seti akati agara makore zana namashanu, akabereka Enoshi.
  spa-BLM: Set vivió ciento cinco años y luego fue padre de Enós.
  beu-beu: Set ana aabetat eeumur mitung 105 muse, ana vaal mehal nu vengajai, ene
    Enos.
  cac-cac: A vin̈aj Set chi', 105 ab'il sq'uinal vin̈ ayic ix alji jun yuninal vin̈
    scuchan Enós.
  swh-ULB: Wakati Sethi alipokuwa ameishi miaka 105, akamzaa Enoshi.
  bel-bel: Сіф жыў сто пяць гадоў і спарадзіў Эноса.
  deu-ELBBK: Und Seth lebte 105 Jahre und zeugte Enos.
  mbb-OT: Hein 105 en is penuiǥen ni Set nevuwad sikandin ki Enosh.
  msc-msc: Sɛti si ka san kɛmɛ ni san loolu bɔ tuma mɛn na, a ka dencɛ sɔrɔn. A ka
    wo tɔɔ la ko Enosi.
  mal-2015: ശേത്തിന്നു നൂറ്റഞ്ചു വയസ്സായപ്പോൾ അവൻ എനോശിനെ ജനിപ്പിച്ചു.
  tuo-NT: Adã́ macʉ̃ Set niꞌcʉ̃ macʉ̃ticʉ niwĩ. Cʉ̃ wĩꞌmagʉ̃rẽ Enós wãme õꞌocʉ niwĩ.
    Cʉ̃ macʉ̃ Enós bajuácaterore ciento cinco cʉ̃ꞌmarĩ cʉocʉ niwĩ.
  gup-gup: Bu Seth mimbini mandjewk 105, wanjh bibornang nawu Enosh.
  met-met: Set nianindi 105, baing xapsaxi Enos.
  gvs-gvs: E Setiyana ana tala ana badabada 105 tutayana natuna koroto yoina Enosi
    ibíbina.
  rmc-rmc: Sar le Šetoske sas šel the pandž (105) berš, uľiľa leske o Enoš.
  nlg-nlg: Tana bona Seth te sakai hangalatu lima (105) na niuluna, me vahua na dalena
    na mane, a Enosh.
  dgr-DOGNT: Set ı̨łèakw'eènǫ-daats'ǫ̀-sı̨làı (105) weghoò ekò wezaa Enosh wegǫ̀hłı̨.
  pes-OPV: و شیث صد و پنج سال بزیست، و انوش را آورد.
  ron-1924: Ла вырста де о сутэ чинч ань, Сет а нэскут пе Енос.
  ben-OBCV: 105 বছর বয়সে শেথ ইনোশের বাবা হলেন।
  lex-lex: La'pa Seta nmor niana anni rahu ida wehrani wolim wa dewade, na'a'na Enos.
  rgu-rgu: Tepoꞌ fo Set teun natun esa lima, boe ma ana hapu ana touꞌ esa, nade Enos.
  som-som: Seedna wuxuu jiray boqol iyo shan sannadood, wuxuuna dhalay Enoos.
  lat-VUC: Vixit quoque Seth centum quinque annis, et genuit Enos.
  aoi-aoi: Eneja kembirra n-ambilyu-manja nakina Jeda 105 mamarika iya yinungkwura
    n-akumajungwunuma arakba nakina nenikuwenikba nenimikirra Yinaja.
  eng-ASVBT: 'And Seth lived a hundred and five years, and begat Enosh:'
  mna-mna: Set ndaama kini irao 105, to ipeebe pikin tomooto ta, zaana Enos.
  ita-1885: E Set, essendo vivuto centocinque anni, generò Enos.
  eng-LXXUP: Now Seth lived two hundred and five years, and begot Enosh.
  eng-ULB: When Seth had lived 105 years, he became the father of Enosh.
  spa-VBL: Cuando Set cumplió la edad de 105 años, tuvo a Enoc.
  fra-_FOB: Seth vécut cent cinq ans, et engendra Énosh.
  mal-mal: ശേത്തിന് 105 വയസ്സായപ്പോൾ അവൻ ഏനോശിനെ ജന്മം നൽകി.
  lit-lit: Ir Setas pragyveno šimtą penkerius metus ir pagimdė Enošą.
  urd-GVR: Set 105 sāl kā thā jab us kā beṭā Anūs paidā huā.
  suz-BL: मिनु सेथ सहे का ५ बर्स दुम्‍मेनु, तौ का थि‍‍माक्‍त। मेको कली एनोश नें वोदा
    बाक्‍त।
  ita-1927: E Seth visse centocinque anni, e generò Enosh.
  ckb-ckb: کاتێک شیت تەمەنی سەد و پێنج ساڵ بوو، ئەنۆش لە نەوەی ئەو لەدایکبوو.
  nas-nas: Teketa tee Set mareꞌ narung daakuꞌketa paꞌnokoꞌ [105] deemparako bauring
    narung pontoꞌaruꞌ miring Iinosiꞌ.
  eng-BBE: 'And Seth was a hundred and five years old when he became the father of
    Enosh:'
  crx-NTPO: Seth 'en 'ilhoh whunizyat whunizyai 'ink'ez kwulat be yus k'ut (105) khuna'
    whe Enosh ooye' suli'.
  kan-OKCV: ಸೇತನು ನೂರ ಐದು ವರುಷದವನಾದಾಗ ಎನೋಷನನ್ನು ಪಡೆದನು.
  bbb-bbb: Ro fari fuone Seti fu fivakuma juaevasia uvani aderedi faeve (105) ijiege
    furiko fu ijia fari fuone e Inosi kuavo ije bietei.
  tam-2017: சேத் 105 வயதானபோது, ஏனோசைப் பெற்றெடுத்தான்.
  spa-RV-1909: Y vivió Seth ciento y cinco años, y engendró á Enós.
  ron-BTF: Şi Set a trăit o sută cinci ani şi a născut pe Enos;
  eng-WEBP: Seth lived one hundred five years, then became the father of Enosh.
  eng-FBV: When Seth was 105, he had Enosh.
  nld-1939: Set was honderd vijf jaar oud, toen hij Enos verwekte.
  nch-BL: Huan Set quipiyayaya 105 xihuit quema tacatqui icone, Enós.
  tfr-NTPO: Set, e öötong l̈u pjl̈ogl̈o sak dbäw kjingsho shkëngshko (105) ga wa buk
    kjl̈ara ko Enós.
  vie-1934: Sết được một trăm năm tuổi, sanh Ê-nót.
  hin-CV: जब शेत 105 वर्ष के थे, तब एनोश का जन्म हुआ.
  eng-OURB: Seth [Appointed] lived one hundred five years, then became the father
    of Enosh.
  spa-BES: Y Set tenía ciento y cinco años cuando llegó a ser padre de Enós.
  tdx-tdx: Ie niveloñe zato taoñe lim’ amby t’i Sete le nisamake i Enose.
  vid-vid: Mhela Seti loyawele na miyaka miya imwe na jihano, nakawa mhaza wa Enoshi.
  pwg-pwg: Seti kana madegha 105 na natuna tomowa itupuwa. Ma ivi vavei Inos.
  eng-OKE: And Sheth lived a hundred and five years, and begat Enosh.
  tha-KJV: เสทอยู่มาได้ร้อยห้าปี และให้กำเนิดบุตรชื่อเอโนช
  por-BR-2018: E viveu Sete cento e cinco anos, e gerou a Enos.
  bco-bco: Sa꞉d e donayo꞉ 105 a꞉la꞉fo꞉wo꞉ ta꞉ta꞉ga꞉, Inoso꞉ a꞉na sa꞉la꞉li.
  deu-ELO: Und Seth lebte hundertfünf Jahre und zeugte Enos.
  ktm-ktm: Set eri krismas tadan ile ndre puken sangat-pe-limweh (105), pe nedun homou
    kamal rangan Enos.
  caa-caa: Pues conda e Set war ucojco 105 año cuxpa inteꞌ uyunen xeꞌ ucꞌabꞌa Enós.
  eng-WYC-2018: And Seth lived an hundred and five years, and (then) begat Enos.
  epo-epo: Kaj Set vivis cent kvin jarojn, kaj naskiĝis al li Enoŝ.
  uig-PIN: Xet bir yüz bǝx yaxⱪa kirgǝndǝ uningdin Enox tɵrǝldi.
  beo-beo: Sede da ode 105 esalu, ea mano Inosie da lalelegei.
  tpi-OTNT: Set i gat 105 krismas na em i kamap papa bilong wanpela pikinini man,
    nem bilong en Enos.
  hau-SA: Sa’ad da Set ya yi shekara 105, sai ya haifi Enosh.
  udu-udu: Dhala Shiiṯ c̱a’bki’d ki e ki yili iss ’kwanimpa imudhe’d i’ce’dka mudhe’d
    mo tani a’di warki’d ka baba ma Anuush mo.
  uig-LAT: Shét bir yüz besh yashqa kirgende uningdin Énosh töreldi.
  nde-nde: Kwathi uSethi esephile iminyaka elikhulu lanhlanu (105) waba nguyise ka-Enoshi.
  ton-ton: 'Pea naʻe moʻui ʻa Seti ko e taʻu ʻe teau ma nima, pea ne fakatupu ʻa ʻInosi:'
  ces-1613: Set pak byl ve stu a pěti letech, když zplodil Enosa.
  eko-eko: Seethi afiiyeevo nyaakha miiya na mithaanu, khunvokola Enooshi.
  nss-nss: Pwen Set ara iyen pe hayou tan iro sangat pe yimah (105) pe iyki mbunah
    kamai hamou ngalan Enos.
  eng-WMB: Seth lived one hundred five years, then became the father of Enosh.
  tam-TCV: சேத் தனது 105 வயதில் ஏனோஸுக்குத் தகப்பனானான்.
  ceb-ULB: Sa dihang nagpangidaron na si Set ug 105 ka tuig, nahimo siyang amahan
    ni Enos.
  mkn-mkn: Waktu Set umur 105 taon, ju dia dapa satu ana laki-laki, nama Enos.
  pol-UBG: Set żył sto pięć lat i spłodził Enosza.
  agr-agr: Set ciento cinco mijan ejeyi pujus uchiji aishmagkun Enósan akiauwai.
  kyc-kyc: Sete baa eekana 105 karapala dokopa Inoso mandeya.
  urd-GVU: سیت 105 سال کا تھا جب اُس کا بیٹا انوس پیدا ہوا۔
  deu-1912: Seth war hundertundfünf Jahre alt und zeugte Enos
  ntj-ntj: Nyangka-ra Yatamaku katja Tjiirrnga nyinarrayirnu kurli-ra 105-pa ngaralanyangka
    katja yini Yiinatjanya yartakanu.
  row-row: Set too natun esa lima ma, ana hambu ana touꞌ esa, naran Enos.
  kan-2017: ಸೇತನು ನೂರ ಐದು ವರ್ಷದವನಾದಾಗ, ಎನೋಷನನ್ನು ಪಡೆದನು.
  ena-ena: Setɨ iamɨnu nudɨ huhɨlɨci iaha hɨnidaci hualɨ 105 umi. Lɨci Setɨ agaŋ ninaŋ
    havami. Nudɨ ibi Enosɨ.
  tgo-tgo: Mbaŋa Set ghatheghathegha vama i wo hothaŋarɨ na umbolima (105) amba thɨ
    ghamba ŋgama ghɨmoru, idae Inos.
  yap-yap: Nap’an ni gaman 105 e duw rok Seth, min gargeleg bochi pagel ni fak ni
    Enosh,
  tet-tet: Oras Set otas tinan atus ida lima, netan oan mane ida naran Enos.
  hlt-MCSB: Seth khaw kum ya neh kum nga a lo vaengah Enosh te a sak.
  mdy-ETH: ሴኤቴ ፄኤታና ዶንጎ ሌዔና ማዓዛ ሄኖሴ ጎዖሢ ሾዔኔ፤
  twi-ASANTE: Set dii mfeɛ ɔha ne enum no, ɔwoo Enos.
  mwc-mwc: Seth kana bodu 105 ba natuna Enosh i tupuwa.
  bhl-bhl: Set em itol e 105 keko, Enos dukuko, em alew kese kale.
  con-NTPO: Setja ciento cinco canqque'fave an'bian'ni tise dutssi'ye Enósve isu.
  eng-WEBU: Seth lived one hundred five years, then became the father of Enosh.
  bnp-bnp: E Set i tahoka a pida i 105 ngane, i vakabelea e Enos.
  wal-wal: Seeti 105 laittaa de7idi, Heenoosa yeliis;
  mgh-mgh: Seeti waapihenre awe myakha iminya nuuwa mithanu (105), ahonnyara Enosi.
  acu-NT: Tura Setka ciento cinco musach pujamtai ni uchiri Enós naartin akiinamiayi.
  spa-PDDPT: Set vivió 105 años y engendró a Enós.
  gun-gun: Ha'e gui ta'y Sete ma cento e cinco ma'etỹ re oikoa py oiko ta'y Enos.
  agu-BL: Ma Set, a'tij jun cient tu o' yob yi ntaxk itz'ij yi cy'ajl yi na bi'aj
    Enós.
  eng-PEV: Seth lived a long time too. He was 105 years old when he had a son called
    Enosh.
  ilo-ULB: Idi nadanon ni Set iti 105 a tawen, naaddaan isuna iti putot ket isu ni
    Enos.
  kpg-kpg: Seth ne 105 ono ngadau, gaa hai dana dama daane go Enosh,
  uig-ARA: شېت بىر يۈز بەش ياشقا كىرگەندە ئۇنىڭدىن ئېنوش تۆرەلدى.
  bsp-bsp: Sɛt ɛnasɔtɔ meren 105, a k'endekom Enɔs.
  mbs-mbs: Peg-apet te sebad gatos aw lima se omay i Set, timebaw se batà din meama
    si Enos.
  tof-tof: Set 105 pail nóma yarilürr, wa Inosón abóm ugón bainürr.
  sus-sus: Seti to bu ɲɛ kɛmɛ ɲɛ suuli, a naxa findi Enosi baba ra.
  pon-2006: Ni Sehd eh sounpar 105, e nainekihda pwutak emen, ede Enos,
  jae-jae: Gêdêŋ taŋ Setnê jala kêtu 105 naŋ, kêka latu Enos lasê.
  ksd-ksd: Ma Set i ga laun vue tika na mar ma a ilima na kilala, ma i ga vangala
    Enos;
  tur-YTC: Şit yüz beş yaşında Enoş'un babası oldu.
  bel-N: І жыў Сэт сто пяць гадоў, і нарадзіў Эноса.
  grc-BRENT: Ἔζησε δὲ Σὴθ πέντε καὶ διακόσια ἔτη· καὶ ἐγέννησε τὸν Ἐνώς.
  ind-AYT: Ketika Set hidup selama 105 tahun, Enos lahir baginya.
  lid-lid: Len Set jaha tan asahan rinek limeh (105), badeh nadun ari asahan nyaran
    Inos.
  nya-nya: Pamene Seti anali ndi zaka 105, anabereka Enosi.
  hrv-hrv: Kad je Šetu bilo sto i pet godina, rodi mu se Enoš.
  mps-mps: Te Set te kibu be bidi sese a naga olama, ogwadu a naga, 105 kibu be bidama,
    te aga ogwa me deligo aya pedelali, nogi Enos.
  llg-llg: Set teun 105, boe ma ana hambu ana tou-anak esa, nade Enos.
  tpi-tpi: Set i gat 105 krismas na em i kamap papa bilong wanpela pikinini man, nem
    bilong en Enos.
  dan-1931: Da Set havde levet 105 År, avlede han Enosj;
  vie-OVCB: Khi Sết 105 tuổi, ông sinh Ê-nót.
  lbk-lbk: Osto ay nentawen si Set is sinkhasot ya lima, winad-ayna nan lalaki ay
    si Enos.
  guj-2017: જયારે તેના પુત્ર અનોશનો જન્મ થયો ત્યારે શેથ એકસો પાંચ વર્ષનો થયો.
  byr-byr: '@see-verse:GEN.005.005'
  awx-awx: Tiwän Selu krismasnä 105 yiwikengä, Enosde nanä däkngakut.
  pon-2006A: Ni Sehd eh sounpar 105, e nainekihda pwutak emen, ede Enos,
  por-BRBSL: Seth viveu cento e cinco anos, depois se tornou o pai da Enosh.
  cth-cth: Seth teh kum 105 touh a pha navah Enosh a khe.
  twi-twi: Set dii mfe ɔha ne anum no, ɔwoo Enos.
  hlt-hlt: Seth khaw kum ya neh kum nga a lo vaengah Enosh te a sak.
  tbz-SIM: Sɛti mɔ̀kɛ dìì mɔ̀nnì yɛbie ntɛkɔ̀ùtɛ̀ nɛ̀ yɛ̀nùmmù (105) kɛ́pɛitɛ́ dɛnitidɑbirɛ
    Enɔsi.
  msy-2020: Ezɨ Set 105plan azeniba itima, an otarim Enos oto.
  txq-txq: Neu Set teun nara 105, boe ma ana hambu ana tou anak esa, nade Enos.
  aaz-aaz: Oras naiꞌ Set nmoin naan toon nautn es toon niim (105), in napein riꞌaan
    moen jes, es reꞌ naiꞌ Enos.
  dop-dop: Sɛɛtɩ pɩɩsɩ lɑpɑ nɩɩnʋwɑ nɑ kɑkpɑsɩ (105) ɩlɛnɑ ɩ́ lʋlɩ Ɩnɔɔsɩ.
  azb-azb: Şet yüz beş yaşında olanda oğlu Enoş doğuldu.
  eng-DBY: And Seth lived a hundred and five years, and begot Enosh.
  hin-2017: जब शेत एक सौ पाँच वर्ष का हुआ, उससे एनोश उत्पन्न हुआ।
  wol-KYG: Set moomee am na téeméeri at ak juróom (105), doora jur Enos.
  swp-swp: Seta ie mia borimai handere esega eo haligigi, muridi eai abo i hemala
    Inosi tamana.
  bjr-bjr: Seetafa 105 aukuana maraseenoo akoonaiqi Eennoosana maqanau.
  eng-YLT: And Seth liveth an hundred and five years, and begetteth Enos.
  kne-kne: Si Set abe, idi nantawen si 105, binmala di anak na ay si Enos.
  heg-NTPO: Dedeng Set umur taun 105, kon un haup ana biklobe mesa, ngala Enos.
  ptu-ptu: Tappana sahatu' limai taunna dadinna Set, undadiammi mesa muane nasangai
    Enos.
  bzd-NTPO: Mik Set ki̱ duas de cien eyök ki̱ ske̱l (105), eta̱ ie' alà wëm kiè Enós,
    e' ku̱ne.
  kwf-kwf: KaidaꞋi sa Set nia dao ana 105 faꞋi ngali ki, nia ka alua sa Enos.
  eng-WYC-2017: And Seth lived an hundred and five years, and begat Enos.
  eng-WMBB: Seth lived one hundred and five years, then became the father of Enosh.
  spp-spp: Sɛti à yyee ŋkuu ná kaŋkuro ta maa Enɔsi si.
  aey-aey: Aria Set uqa bibilen li uqana cabi gel eu 105 eu odi caleceb uqa aideg
    mel oso basen. Odocob ijan Enos qon.
  urd-GVH: सेत 105 साल का था जब उसका बेटा अनूस पैदा हुआ।
  rug-rug: Sipu keke gogoto lima vuahenina se Seti, si podo mae se Inosi.
  gaz-gaz: Seeti waggaa 105 jiraatee Enooshin dhalche.
  fra-LSG: Seth, âgé de cent cinq ans, engendra Énosch.
  gnn-gnn: Yadamgunydja ŋunhi walkur Djap ŋuthara wakindhina ḏarramuyinana, bala ŋayi
    walkurmirriyinana, ga yäku nherraranydja ŋayi ŋanya walkurnhanydja nhanŋuway Yenutj.
    Ga ŋuliŋuruyinydja bala guḻku'thinana walkurnydja nhanbala marrtjina, ḏarramuwurru
    ga dhäykawurru, yana liŋgu‐u‐u Djaptja marrtjina worruŋuyinana, bala yana ŋayi
    ḏalpamdhinana, dhuŋgarranydja nhanŋu Djapku 912‐nha.
  yal-yal: Seti to bu ɲɛɛ kɛmɛ ɲɛɛ suulun, a yi Enosi bari.
  gum-gum: Setbe pilamera ciento cinco tøgagua, nusrkai Enóswan tøgaguig køn.
  iou-iou: Adam nanaki Set unitä obaŋ 105 täreŋirän nanaki tuäni wäpi Enos ahäŋkuk.
  haw-1868: 'Hookahi haneri makahiki a me kumamalima o ko Seta ola ana, a hanau ae
    la o Enosa nana:'
  arb-NAV: كَانَ عُمْرُ شِيثٍ مِئَةً وَخَمْسَ سَنَوَاتٍ عِنْدَمَا أَنْجَبَ أَنُوشَ.
  adz-adz: Gubuꞌ Set mpada udzufan basangꞌa 105, da arangan irim narunggan Inos.
  ewe-ewe: Set xɔ ƒe alafa ɖeka kple atɔ̃ (105) hafi dzi Enos.
  nuy-nuy: Nigaayung naagi-yung na-Seth, ni-burri 105 anaagalhal-aḻirr. Bani-yung
    marri nu-lhamayn naagi-yung na-niwiyayung na-Enosh.
  eng-LEE: And Sheth lived a hundred and five years, and begat Enosh.
  dji-dji: Manymak, nyani Sit walkiri marrngili Inutj, ga Inutj walkiri marrngili
    Kinan, ga Kinan walkiri marrngili Mayalalil, ga Mayalalil walkiri marrngili Djarid,
    ga Djarid walkiri marrngili Inuk. Djiniwili yulpili djin nyininyi djin bininy
    ngurrguma wanngigakiṉing miri Adam, ga djin walkiri djamini galbi djina walguwalgur
    nyibi mala.
  nna-nna: Seth 105 partunurrangujartiny jarrinyaja, japartu jarrinyi partany pirirriku,
    Enosh.
  asm-FB: চেথৰ যেতিয়া এশ পাঁচ বছৰ বয়স হ’ল, তেতিয়া তেওঁৰ পুত্ৰ ইনোচৰ জন্ম হ’ল।
  sus-A: سٍتِ تٌ بُ حّ كّمّ حّ سُولِ، عَ نَشَ قِندِ عٍنٌسِ بَبَ رَ.
  fra-SBL: Seth vécut cent cinq ans, puis devint le père d'Enosh.
  hbo-hbo: וֽ͏ַיְחִי־שֵׁ֕ת חָמֵ֥שׁ שָׁנִ֖ים וּמְאַ֣ת שָׁנָ֑ה וַיֹּ֖ולֶד אֶת־אֱנֹֽושׁ׃
  shp-NTPO: Set, pacha pichika baritiaya iketianra, jawen benbo bake Enós pikota iki.
  eng-WYCLIFFE: Also Seth lyuede an hundrid and fyue yeer, and gendride Enos.
  pjt-pjt: Ka Tjiitjinya puḻkaringkula yiya tjuṯaṯu nyinangi, munu 105 nyinanytjatjanu
    katjatjararingu munu katja palunya ininu Inatjanya. Munu palula maḻangka paluṟu
    piṟuku yiya tjuṯa mulapa nyinangi nampa 807 munu tjitji kutjupa tjuṯatjararingangi.
    Munu ngula mulapalta ilungu yiya 912 nyinanytjatjanu rawa mulapa.
  cwe-cwe: Seti viyakalile na miyaka gana na tano, kamweleka mwana zina jake Enosi.
  bgs-bgs: Tô sábbad gatus lima (105) dán tô idad i Set, ipamasusu tô batà din mama
    na si Enos.
  kik-kik: Sethi aakinyia mĩaka igana na ĩtano-rĩ, akĩgĩa na mũriũ wetagwo Enoshu.
  ksr-ksr: Komuro meria Seet iinoŋ yambuya 105 tegoro meria Enos kolooro.
  omb-omb: I Set mo toga higao vudolue avigi gailime mo bamba Enos.
  fra-NCL: Seth vécut cent cinq ans, et il engendra Enos.
  cek-AK: Seth loe saning cumvaito pacoeng, pangato hing naah, Enos to sak.
  xla-xla: Epame Settapo 105 sokomoko halepame ya꞉lluta maseyemala hamaiyo, ya꞉ hiye
    Enos.
  cuk-cuk: Set birga-dulatar-gakatar-nikadgi (105), e-machi-Enós gwalulesad.
  uig-CYR: Шет бир йүз бәш яшқа киргәндә униңдин Енош төрәлди.
  tel-2017: షేతుకు నూట ఐదు సంవత్సరాల వయస్సులో ఎనోషు పుట్టాడు.
  hat-BSA: Seth te viv san-senkant ane, e li te vin papa Énosch.
  kos-kos: Ke Seth el yac siofok limekosr, oasr wen se natul pangpang Enosh,
  hbo-WLC: וַֽיְחִי־שֵׁ֕ת חָמֵ֥שׁ שָׁנִ֖ים וּמְאַ֣ת שָׁנָ֑ה וַיּ֖וֹלֶד אֶת־אֱנֽוֹשׁ׃
  ibo-ibo: Set gbara narị afọ na ise mgbe ọ ghọrọ nna Enọsh,
  ory-ory: ଶେଥ ଶହେ ପାଞ୍ଚ ବର୍ଷ ବୟସରେ ଈନୋଶକୁ ଜାତ କଲା;
  chk-chk: Iwe, lupwen Set a ierini ipükü limu, a nöüni Enos.
  ssd-ssd: Set nu yar 105 ŋak minna sulumba kiŋo ande nyunu Enos te-pilna. Te-pilna
    sulumba nu maŋ lato yar 807 minmba kiŋo kulim afu turmba kile-patikina. Nuŋe yar
    ulendimba 912 kusrena sulumba nu kumna.
  rop-rop: Wal Seth bin merrit, en wen imbin olmen 105 yiya ol, imbin abum lilboi
    neim Inash,
  ukr-1871: Як було ж Сетові сто і пять год, появив Еноса.
  eng-AOI: When Seth was 105 years old he had a son called Enosh.
  yon-yon: Set kuu weeb 105iib doberekore, ye mingki Inos kuu woonoon.
  bch-bch: Set aea rai buno ede igegea lima (105), be iadaoa ipopo gergeu aranga ieda
    Enos.
  deu-1951: Seth war 105 Jahre alt, als er den Enosch zeugte;
  eng-JPS: And Seth lived a hundred and five years, and begot Enosh.
  ubr-ubr: Seth ima an kwanda 105 an rai on natun orot Enosh irat.
  srp-1865: A Sit poživje sto i pet godina, i rodi Enosa;
  lug-lug: Seezi bwe yaweza emyaka kikumi mu etaano n’azaala Enosi.
  heb-heb: ויחי שת חמש שנים ומאת שנה ויולד את אנוש׃
  ben-IRV: শেথ একশো পাঁচ বছর বয়সে ইনোশের জন্ম দিলেন।
  pan-pan: ਸੇਥ ਇੱਕ ਸੌ ਪੰਜ ਸਾਲਾਂ ਦਾ ਸੀ ਤਦ ਉਸ ਤੋਂ ਅਨੋਸ਼ ਜੰਮਿਆ।
  mwp-mwp: Sethan nanga 105 wathal aymoeydhin, nuydh garkaz kazi gasamoedhin nel Enos.
  mya-JVB: ရှေသ သည် အသက် တရာ ငါး နှစ် ရှိသော်၊ သားဧနုတ် ကို မြင် လေ၏။
  tte-O: Seti ana bolime 105 kabo natuna ikabi esana Inosi.
  tbg-tbg: Setiva 105 ihi vara kero viva qorainti vainti Enosira vatatora.
  hmo-hmo: Seta ena mauri lagani be 105 neganai, ia ese Enosi ia havaraia.
  ata-ata: Xe ꞌolu Seti ne mumaulixu tauu ie loxo itemaxu taꞌuve mo taꞌuve (105) mukalu,
    la mupalaa ꞌolu mulu, ualasou lexe Enosi.
  nfa-nfa: Lodꞌo Set dꞌai 105 (ca ngasu lèmi) tèu, na abhu ana mone ca dhèu, ngara
    na Enos.
  urd-urd: और सेत एक सौ पाँच साल का था जब उससे अनूस पैदा हुआ।
  rus-SYN: Сиф жил сто пять лет и родил Еноса.
  cbt-NTPO: Sito pasa a'natërápo pi'ipitaso', hui'nin nasitërin. Nasitohuachina, Inosë
    itopi.
  bqc-SIM: Sɛti wɛ̃̀ basↄosↄode (105) guu ↄ̃ à Ɛnↄsi ì.
  tcz-CHONGTHU: Seth chu kum jakhat le kum nga ahi chun ama chu Enosh pa ahung hi
    tai.
  mar-mar: शेथ एकशे पाच वर्षांचा झाल्यावर त्यास अनोश झाला
  tcs-tcs: Wen Set i bin kese 105 iya oul, em bin gad wan boi pikinini, ane em bin
    kolem Inos.
  qub-qub: Set pachac pichgan (105) watayoj caycaptin wamran Enós yuriran.
  bqp-bqp: Sɛti wɛ̃̀ basↄↄro awɛɛsↄↄrode gũn à Ɛnↄsu ì.
  hat-hat: Sèt te gen sansenkan (0105 an) lè li vin gen yon pitit gason yo te rele
    Enòk.
  eng-BSB: When Seth was 105 years old, he became the father of Enosh.
  tod-tod: Sɛte ná-konagi ɠɛai ma ga ungila dɔɔlugɔ (105), é Enɔse zɔlɔɔni.
  eng-WEBPB: Seth lived one hundred and five years, then became the father of Enosh.
  kbq-kbq: Hagi Seti'a 105fu'a zagegafu nehuno, ne' mofavre eri fore huno agi'a Enosi'e
    huno antemi'ne.
  nhe-BL: Huan Set quipiyayaya 105 xihuitl quema tlacatqui icone, Enós.
  sps-sps: Set te kaakaa sa onots sen natus ana ngim a ingainy sa ruak iny taman a
    isen a guei tsoiny e Enos.
  bus-bus: Sɛti wɛ̃̀ basↄↄro asↄↄrodee guun à Ɛnↄsu ì.
  gub-BL: 15 kwarahy hereko mehe uzexak kar ta'yr Enoz her ma'e Xet pe a'e.
  eng-DRA: Seth also lived a hundred and five years, and begot Enos.
  knf-knf: Wi Ŧet adoluŋ ŋşubal iñeen-week na kañeen (105) aşë buk Enoş.
